import { Link } from 'react-router-dom'
import { AlbumContainer, AlbumCover, AlbumContent, AlbumName, TracksList, Track } from './Album.style'

const Album = ({ album, handleSelect }) => {
  return (
    <AlbumContainer key={album.id}>
      <AlbumCover src={album.cover_art_url} alt={album.name} />
      <AlbumContent>
        <AlbumName> {album.name} </AlbumName>
        <TracksList>
          {album && album.tracks.map(track =>
            <Track onClick={() => handleSelect(track.song.id, 'song')} key={track.song.id}>
              <Link to={`/song/${track.song.id}`}> {track.song.title} </Link>
            </Track>
          )}
        </TracksList>
      </AlbumContent>
    </AlbumContainer>
  )
}

export default Album
